import React from 'react';
import './Card.css';
import { Link } from 'react-router-dom';

export default function Card({ min, max, name, img, onClose, id }) {
  return (
    <div class="h-64 w-3/6 bg-gradient-to-r from-green-300  to-green-700 rounded-lg">
      <div >
        <button onClick={onClose} class="py-0.2 px-1 text-white rounded-lg bg-red-500 shadow-lg">x</button>
      </div>
      <div class="text-white">
        <Link to={`/city/${id}`}>
          <h5 className="card-title">{name}</h5>
        </Link>

        <div className="flex flex-row justify-around">
          <p class="text-blue-800">
            Min </p>
          <p>{min}°</p>

          <p class="text-red-400">Max</p>
          <p>{max}°</p>
        </div>

        <div >
          <img src={"http://openweathermap.org/img/wn/" + img + "@2x.png"} width="80" height="80" alt="" />
        </div>

      </div>
    </div>
  );
};
